#directores de templos

select * from persona;


select t.nombre_templo, t.fk_religion, l.nombre_lugar from templo t, lugar l, lugar l2, lugar l3 where t.fk_lugar = l3.id_lugar and l3.fk_lugar = l2.id_lugar and l2.fk_lugar = l.id_lugar;
select p.fk_lugar, p.nombre_persona, l.nombre_lugar from persona p, lugar l, lugar l2, lugar l3 where p.fk_lugar = l3.id_lugar and l3.fk_lugar = l2.id_lugar and l2.fk_lugar = l.id_lugar;